import styled from "styled-components";

const MainRoomNamePresenter = styled.div`
    width: 100%;
    height: 70px;

    display: flex;
    align-items: center;

    color:white;
    font-size:30px;
    vertical-align: middle;
    background-color: #1D3DD6;
    padding-left:20px;
`

export default MainRoomNamePresenter;
